import React from 'react'
import '../../../../../Styles/Home/Grid/Contact/Views/Github.css'

const Github = () => {
    return (
        <div>
            <h1>Github Account</h1>
            <p>
                <a href="https://github.com/littlepotato123">Go To My Github Pages</a>
            </p>
        </div>
    );
}


export default Github;
